transforms.result:
.top {
  justify-content: flex-start;
  div {
    font-size: 18px;
    font-weight: bold;
    &:first-child {
      width: 30%;
      padding-left: 10px;
      margin-right:10px;
      margin-bottom: 0;
    }
  }
}

.phone {
  div {
    &:nth-child(1) {
      font-size: 15px;
      line-height: 1.2rem;
    }
    &:nth-child(2) {
      line-height: 1.5rem;
      margin-top: 20px;
      ul {
        li {
          &:nth-child(1) {
            margin-bottom: 10px;
          }
          &:nth-child(2) {
            margin-bottom: 10px;
          }
          div.input-box {
            display: flex;
            justify-content: space-between;
          }
          div {

          }
          button {
            width: 200px;
            margin-left: 10px;
          }
        }
      }
    }
  }
}

.red {
  font-weight: bold;
  margin-top: 20px;
  line-height: 1.3rem;
  color: $c-b500;
}
